    Buffer.BlockCopy (dataBs, 0, dest, nextFreeIdx5, dataBs.Length)
    let nextFreeIdx6 = nextFreeIdx5 + dataBs.Length
    dest.[nextFreeIdx6] <- 1uy // write the SOH field delimeter
