let ReadMiscFeeBasis (pos:int) (bs:byte[]) : (int * MiscFeeBasis) =
    let pos2, valIn = ByteArrayUtils.readValAfterTagValSep pos bs
    let fld = 
        match valIn with
        |"0"B -> MiscFeeBasis.Absolute
