let ReadField (pos:int) (bs:byte[])  =
    let pos2, tag = ByteArrayUtils.readTag pos bs
    let pos2 = pos2 + 1
    match tag with
    | "1"B ->
        let pos3, fld = ReadAccount pos2 bs
        pos3, (fld |> FIXField.Account)
